import React from "react";
import Alert from 'react-bootstrap/Alert';

let notfound = (props) => {
    return (
        <div>
        <Alert style={{textAlign: "e"}} variant={props.color}>
          {props.title}
       </Alert>
        </div>

    )
}

export default notfound
